@hilarybennmp Provided MPs are given a free vote &amp; not threatened by the whips, so they can put country before party.

I have no confidence that that will happen, so I support a #PeoplesVote, to include those disenfranchised 2 yrs ago, 16-17s + proper, factual debate.
#FBPE

@ajhellyer52 @hilarybennmp @jennymatthews9 @jk_rowling Shall we review the facts?
(i) Corbyn appointed an inclusive Shadow Cabinet: from the left, centre &amp; right of the party;
(ii) In June 2016 the right &amp; centre flounced out &amp; launched a leadership challenge;
(iii) This left Labour ~20% behind in the polls going into the election.

@jennymatthews9 @hilarybennmp @jk_rowling Indeed, much better simple to ignore the reality of impending disaster and bury your otherwise empty head into the sand.
