Lipstick on a pig
Polishing a turd.

@hilarybennmp @Jim_Cornelius Great summary of where we are, @hilarybennmp, but we are here in part because the the only force of opposition the Government faces is from its own party. 
 What is the meaningful, positive alternative offered by Labour?
(Not a dig - I just would seriously like to know).

@hilarybennmp A new referendum on a deal we know would be a meaningful vote.
2016 was a vote on the unknown. #PeoplesVote would be a vote on the Known. Just as a Gneral Election is a vote on the known record of the sitting government.
Who could object to that except opponents of democracy?

@CllrWalshaw @fascinatorfun @hilarybennmp @KimSJ Anyone who is fed up of whataboutism should recognise "what about the Tory rebels?" for what it is.

What the Tories do is *no* excuse for your party not voting to protect my interests as a British expat.

You want Labour to lead the country? So do I. So start leading.

@CllrWalshaw @lunaperla @fascinatorfun @hilarybennmp @KimSJ Are you for real? (to use your well-loved word)

Now you are starting to sound like one of those many trolls on twitter. And if you don't know why, maybe some reflection time (or asking a friend) will help.
Bye-bye

